import getCategoriesList from './main';

function NavbarCategorias(props) {
    console.log(props.categoriesList);
    //let categories_list = getCategoriesList();
    //let categories_list = props.categoriesList;
    return (
        <ul className='navbar-nav'>
            {props.categoriesList.map((category, index) => {
                return (
                    <li className='nav-item text-center' key={index}>
                        <button className='btn text-secondary bg-transparent text-hover-color' type='button' onClick={() => console.log(category)} id={category}>
                            {`${category.charAt(0).toUpperCase() + category.slice(1)}`}
                        </button>
                    </li>
                );
            })}
        </ul>
    );
}

export default NavbarCategorias;
